import * as React from "react";
import { SafeAreaView, StyleSheet } from "react-native";
import { BottomNavigation, Text } from "react-native-paper";

const movRoute = () => {
  return(
    <SafeAreaView>
      <Text>Movimientos</Text>
    </SafeAreaView>
  );
}
export default movRoute;
